import React, { component } from 'react';
<link href="https://fonts.googleapis.com/css?family=Montserrat" rel="stylesheet"></link>
const CardImage = ({src}) => {
    return(
        <img src={src} className="w-100 w-100-ns"></img>
    );
}
export default CardImage;
